import React from 'react'

export default function Imagebox(link, alt, text) {
  return (
    <div style = { { display: 'flex', flexDirection: 'row', gap: '0.5em'}}>
        <img src={link} alt={alt}/>
        {text} ? <p>{text}</p> : null
    </div>
  )
}
